import React, { PureComponent } from 'react'

//styled
import Outer from './styled/Outer'

export default class Skill extends PureComponent {

    render(){

        const {
            id,
            source,
            title
        } = this.props

        return(
            <Outer>
                <h3>{title}</h3>
                <img src={source} id={id} alt="logo" width={1000} height={100}/>
            </Outer>
        )
    }
}
